import axios from "axios";
import { useState } from "react";

export default function Form1(props) {
    const [response, setResponse] = useState(null);
    const [data,setdata]=useState(
        {
            first :'',
            family : '',
            cin: '',
            email: '',
            rib: '',
            balance: '',
        }
    );

    const handle = (e) => {
        const { name, value } = e.target;
        setdata({ ...data, [name]: value });
      };


    const sendSoapRequest = async () => {
        const url = '127.0.0.1:8000/bank/management/'; // Replace with your SOAP service URL
        const soapEnvelope = `<?xml version="1.0" encoding="UTF-8"?>
        <soapenv:Envelope xmlns:soapenv="http://schemas.xmlsoap.org/soap/envelope/"
                          xmlns:web="http://www.example.com/webservice">
           <soapenv:Header/>
           <soapenv:Body>
              <web:YourSoapRequest>
                 <web:parameter1>value1</web:parameter1>
                 <web:parameter2>value2</web:parameter2>
              </web:YourSoapRequest>
           </soapenv:Body>
        </soapenv:Envelope>`;
    
        const config = {
          headers: {
            'Content-Type': 'text/xml;charset=UTF-8',
            'SOAPAction': 'YOUR_SOAP_ACTION' // Specify SOAP action if required
          }
        };
    
        try {
          const response = await axios.post(url, soapEnvelope, config);
          setResponse(response.data); // Update the response state with the data
        } catch (error) {
          console.error('SOAP request error:', error);
        }
      };

    
    return (
        <form className='text-neutral-800 transition-all duration-300 font-regular text-[18px] px-8 w-full flex flex-col items-center gap-6'>
            <div className='flex gap-8 w-full h-full items-center'>
                <div className='flex flex-col gap-1 w-full'>
                    <label  for='first'>First Name</label>
                    <input id='first' value={data.first} onChange={handle} name='first' className='ring-1 ring-neutral-500 rounded-sm outline-none px-2 py-1 text-[16px] text-neutral-700 '></input>
                </div>
                <div className='flex flex-col gap-1 w-full'>
                    <label  for='family'>Family Name</label>
                    <input id='family' value={data.family} onChange={handle}  name='family' className='ring-1 ring-neutral-500 rounded-sm outline-none px-2 py-1 text-[16px] text-neutral-700 '></input>
                </div>
            </div>
            <div className='flex gap-8 w-full h-full items-center'>
                <div className='flex flex-col gap-1 w-full'>
                    <label  for='cin'>CIN</label>
                    <input id='cin' name="cin" value={data.cin} onChange={handle}  className='ring-1 ring-neutral-500 rounded-sm outline-none px-2 py-1 text-[16px] text-neutral-700 '></input>
                </div>
                <div className='flex flex-col gap-1 w-full'>
                    <label  for='email'>Email</label>
                    <input id='email' name="cin" value={data.email} onChange={handle}  className='ring-1 ring-neutral-500 rounded-sm outline-none px-2 py-1 text-[16px] text-neutral-700 '></input>
                </div>
            </div>

        <div className='flex gap-8 w-full h-full items-center'>
            <div className='flex flex-col gap-1 w-full'>
                <label  for='rib'>RIB</label>
                <input id='rib' className='ring-1 ring-neutral-500 rounded-sm outline-none px-2 py-1 text-[16px] text-neutral-700 '></input>
            </div>
            <div className='flex flex-col gap-1 w-full'>
                <label  for='balance'>Initial Balance</label>
                <input id='balance' className='ring-1 ring-neutral-500 rounded-sm outline-none px-2 py-1 text-[16px] text-neutral-700 '></input>
            </div>
        </div>
               <button type="button" className='py-2 px-6 bg-neutral-800 hover:bg-neutral-900 transition-all duration-300  text-white rounded-md mt-4 w-full'> Add Account  </button>
               <div className='text-[16px] text-neutral-600 flex justify-center ml-6 gap-5 w-full'>
                <button type='button' className='hover:text-neutral-800' onClick={()=>props.setForm(true)}> View Account</button>
                -
                <button type='button'  className='hover:text-neutral-800'>View All Accounts </button>
               </div>
               <p>{response!= null && response}</p>
        </form>
    )
}
